import * as React from 'react';
import { 
  Appbar, 
  Card,
  Title,
  Paragraph,
  Button,
  Avatar,
  Provider as PaperProvider,
  DefaultTheme,
  List,
  Divider,
 } from 'react-native-paper';
import { View } from 'react-native';
import WelcomeIamge from './assets/Welcome.png'


const HomeComponent=() => {

  return(
<View>
    <Card>

      <Card.Cover  source={WelcomeIamge} style={{ width: 500, height: '1000%' }}/>
    </Card>
  </View>
  );
}




export default function App() {

  const theme = {
    ...DefaultTheme,
    colors: {
      ...DefaultTheme.colors,
      primary: 'red',
      accent: 'green',
      text: 'brown',
      background: 'blue',
      surface: 'white',
      disabled: 'grey',
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center'
    },


  };

    return (
      <PaperProvider theme={theme}>
      <HomeComponent />
    </PaperProvider>
    );
}
